const Home = () => {
  const [query, setQuery] = useState("");
  const [isDark] = useTheme()

  return (
    <main className={`${isDark ? 'dark' : ''}`}>
  <div className="search-filter-container">
    <SearchBar setQuery={setQuery}/>
    <SelectMenu />
  </div>z
    <CountriesList query={query}/>
    </main>
  )
}

export default Home
